(32, '799768', NULL, NULL, 11, 69, 'רויאל קנין יורקשייר אדולט 3 ק\"ג', '3182550799768', '129', '66.15', NULL, NULL, '3220211205200626.jpg', NULL, NULL, 'רכיבים: חלבון עופות מיובש, קמח תירס, אורז, שומן מהחי, אייסולאט של חלבון \nמהצומח, תירס, חלבונים מהחי שעברו הידרוליזה, גלוטן תירס, סיבים צמחיים, \nציפת סלק, שמן דגים, מינרלים, שמן סויה, שמרים וחלקיהם, \nפרוקטו-אוליגו-סכרידים, שמרים שעברו הידרוליזה (מקור למנו-אוליגו-סכרידים),\n שמן זיפן (בוראג\') (0.1%), סרטניים שעברו הידרוליזה (מקור לגלוקוזמין), \nתמצית ציפורן חתול (מריגולד, כמקור ללוטאין), סחוס שעבר הידרוליזה (מקור \nלכונדרויטין), קלינופטילולייט (5 גר\'\\ק\"ג), תמצית תה (מקור לפוליפנולים: \n150 מ\"ג\\ק\"ג), חומרים משמרים- חומרים נוגדי חימצון.\n\nתוספי תזונה \nמוספים (לק\"ג): ויטמין A – 29500 יחב\"ל, ויטמין 3D – 800 יחב\"ל, ביוטין 3 \nמ\"ג, 1E (ברזל) – 45 מ\"ג, 2E (יוד) – 4.5 מ\"ג, 4E (נחושת) – 14 מ\"ג, 5E \n(מנגן) – 58 מ\"ג, 6E (אבץ) – 137 מ\"ג,  8E (סלניום) – 0.1 מ\"ג.\n\nערכים תזונתיים: חלבון 28%, שומן 18%, לחות 9.5%, אפר גולמי 5.1%, סיבים גולמיים 3%\nאנרגיה מטבולית: 3948 קק\"ל\\ק\"ג\nחלבון בעל נעכלות גבוהה מאוד - L.IP', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '3', NULL, 51, NULL),
