(38, '030838', NULL, NULL, 10, 72, 'סאינס פלן חתול אדולט עוף 3 ק\"ג', '052742030838', '119', '70', NULL, NULL, '3820220116120338.jpg', NULL, NULL, NULL, '<p><strong style=\"color: rgb(43, 30, 30);\"><em>מזון יבש לחתולים (עם עוף) המכיל חלבון איכותי לסיוע בבניית מסת שריר רזה. מספק ויטמין E וחומצות שומן מסוג אומגה 3 ו-6 לעור בריא, ומינרלים מאוזנים לתמיכה בבריאות האיברים החיוניים.</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>החתול הבוגר שלכם זקוק למזון המסייע לבריאות העיכול, לפרווה מבריקה, לשרירים רזים ולמערכת חיסון בריאה. מזון יבש Hill\'s Science Plan לחתולים בוגרים מיוצר ממרכיבים איכותיים וקלים לעיכול בנוסחה שפותחה במיוחד לסיפוק צורכי האנרגיה של חתולים במיטב שנותיהם.</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>כמזון לחתולים המיוצר ממרכיבים איכותיים ביותר, Hill\'s Science Plan לחתולים בוגרים מספק ויטמין E בתוספת חומצות שומן מסוג אומגה 3 ואומגה 6 לטיפוח עור החתול. מזון משובח זה, הגדוש בחלבון איכותי, מסייע גם לחתול שבגר לבנות שרירים רזים.</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>בנוסף, מזון יבש לחתולים בוגרים מספק לחתול הבוגר טאורין חיוני ומינרלים מאוזנים התומכים בבריאות הלב, ובתפקוד שלפוחית השתן והכליות.</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>מומלץ עבור: חתולים בוגרים בני 1-6 שנים</em></strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '3', '39,26,74,40', 29, NULL),
