(91, '024004', NULL, NULL, 10, 72, 'סאינס פלן חתול סניור 3 ק\"ג', '052742024004', '129', '74', NULL, NULL, '9120220116124046.jpg', NULL, NULL, NULL, '<p><strong style=\"color: rgb(43, 30, 30);\"><em>מזון יבש לחתולים מבוגרים (עם עוף) להזדקנות בחן. מכיל מרכיבים קלים לעיכול, חלבון איכותי ביותר לסיוע בבניית מסת שריר רזה, טאורין לסיוע לבריאות הלב, ואומגה 6 לסיוע לבריאות העור והפרווה.</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>החתול שלכם אולי מזדקן, אך אין זה אומר שהוא מחוץ למשחק.</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>מזון יבש HILL\'S SCIENCE PLAN לחתולים מבוגרים 7+, מסייע לחתול להזדקן בחן על ידי תערובת סינרגיסטית התומכת ברמת האנרגיה והפעילות של חתולים בגיל המבוגר.</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>מזון זה לחתולים מבוגרים המיוצר מהמרכיבים האיכותיים ביותר מספק לחתולים בגיל 7 שנים ומעלה: טאורין - מרכיב חיוני לבריאות הלב. מינרלים מאוזנים התורמים לבריאות דרכי השתן והכליות, ויטמין E וחומצות שומן מסוג אומגה 3 ואומגה 6, התומכים בבריאות העור והפרווה.</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>מכיוון שחתולים מבוגרים יכולים לסבול מרגישות בבטן, מזון זה מיוצר ממרכיבים קלים לעיכול.</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>מומלץ עבור:</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>חתולים מבוגרים בני 7+ שנים.</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>יתרונות עיקריים:</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>▸ מספק לחתולים בגיל המבוגר טאורין החיוני לבריאות הלב ומינרלים מאוזנים לסיוע בבריאות דרכי השתן והכליות</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>▸ תומך בעור ופרווה בריאים הודות לוויטמין E, אומגה 3 ואומגה 6</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>▸ מזון יבש קל לעיכול לחתולים מבוגרים</em></strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '3', '39,40,27,74', 35, NULL),
