(652, '894104', NULL, NULL, 11, 69, 'רויאל קנין מיני לייט ווייט קייר 3 ק\"ג', '3182550894104', '129', '66.15', NULL, NULL, '65220211205203955.jpg', NULL, NULL, 'רכיבים: חלבון עופות מיובש, תירס, שעורה, אורז, אייסולאט של חלבון מהצומח, \nגלוטן תירס, חלבונים מהחי שעברו הידרוליזה, סיבים צמחיים, שומן מהחי, ציפת \nסלק, אבקת צלולוז, מינרלים, שמן דגים, שמרים וחלקיהם, שמן סויה, זרעי \nוקליפות פסיליום, פרוקטו-אוליגו-סכרידים, שמן זיפן (בוראג\'), תמצית ציפורן \nחתול (מריגולד, כמקור ללוטאין), חומרים משמרים- חומרים נוגדי חימצון.\n\nתוספי\n תזונה מוספים (לק\"ג): ויטמין A – 22000 יחב\"ל, ויטמין 3D – 1000 יחב\"ל, 1E\n (ברזל) – 36 מ\"ג, 2E (יוד) – 3.6 מ\"ג, 4E (נחושת) – 11 מ\"ג, 5E (מנגן) – \n47 מ\"ג, 6E (אבץ) – 136 מ\"ג,  8E (סלניום) – 0.04 מ\"ג.\n\nערכים תזונתיים: חלבון 30%, שומן 11%, לחות 9.5%, אפר גולמי 5.2%, סיבים גולמיים 6.6%\nאנרגיה מטבולית: 3371 קק\"ל/ק\"ג\n\nחלבון בעל נעכלות גבוהה מאוד - L.I.P\n', NULL, NULL, NULL, NULL, 1, NULL, NULL, 'kg', '3', '36,26,20', 22, NULL),
