(658, '017985', NULL, NULL, 10, 72, 'צ\'יקופי חתול קלאסיק אינדור בקר 15 ק\"ג', '4015598017985', '289', '165', NULL, NULL, '65820220212205920.png,65820220116082800.jpg', NULL, NULL, 'חלבון עופות (עוף מיובש 24%), תירס,סורגום, בקר (בקר מיובש 5%), שומן עוף, ציפת סלק מיובשת (בלי סוכר), חלבון שעבר הידרוליזה, אפונה (יבשה, 2%), קמח כבדים (2%), חריע (1%), שמן סלמון (0.5%), שמרים (יבשים, 0.5%), עולש (מיובש, 0.5%), אשלגן כלוריד.\n\n\nערכים תזונתיים מזון לחתול צ\'יקופי אינדור/ Chicopee Indoor:\n\nחלבון 31%\nשומן 16%\nתאית 2.5%\nתאית 6.7%\nסידן 1.4%\nזרחן 1.10%\nאשלגן 0.6%\nנתרן 0.35%\nמגנזיום 0.1%', '<p><strong><em>צ’יקופי אינדור, מזון יבש פרימיום לחתול ביתי, המיוצר בגרמניה עבור חברת הריסון/Harrison הקנדית. המזון מיועד לחתולים בייתים בעלי רמת פעילות רגילה והינו בעל טעימות גבוהה, מכיל יוקה להפגת ריחות, אומגה 3 ואומגה 6 לפרווה מבריקה ואף רמת חומציות נמוכה לטיפול נכון בדרכי השתן.</em></strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '15', '43,26', 40, NULL),
