(3217, '560064', NULL, NULL, 10, 72, 'פרו-פלן חתול סטרלייזד סלמון 3 ק\"ג', '7613033560064', '129', '69.68', NULL, NULL, '321720211206175234.jpg', NULL, NULL, ' סלמון (20%), חלבוני עוף מיובשים, אורז, קמח גלוטן תירס, תירס,\n קמח גלוטן חיטה, סובי חיטה, תאית, אבקת ביצים, מינרלים, שומן מן החי, מצוי\n מן החי, שמרי בירה, שמן דגים.           \nתכולה תזונתית באחוזים\n\n            \n\n\n            חלבונים: 41%, שומנים: 12%, לחות: 12%, אפר: 7.5%, תאית: 4.0%,\n סידן: 1.25%, זרחן: 1.05%, מלח: 1.53%, אנרגיה מטבולית: 3,760 קק\"ל/ק\"ג\n            \n\n\n           \n\n                   \n\n\n           ', 'פרו פלאן STERILISED, מזון יבש מלא לחתולים בוגרים, מותאם לשמירה על \nתפקוד תקין של דרכי השתן התחתונות בחתולים בוגרים לאחר עיקור או סירוס. \nמכיל את נוסחת ה-OPTIRENAL המוכחת מחקרית בשמירה על בריאות הכליות בחתולים.\n \n\nתכונות ויתרונות\nתומך בבריאות מערכת השתן ומפחית את הסיכון להתפתחות זיהום ודלקות בדרכי השתן התחתונות \nמכיל כופתיות פריכות במיוחד, לשמירה על היגיינה דנטאלית ועל בריאות השיניים והחניכיים \nמסייע בשמירה על מסת גוף ומשקל תקין בזכות איזון רמות אחוז החלבון והשומן \n\n        \n        ', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '3', '26,41,52', 55, NULL),
