(4786, '785452', NULL, NULL, 37, 87, 'ליטל וואן עשב אחו למכרסמים 400 ג\' ', '4602533785452', '29', '10.39', NULL, NULL, '478620211230222726.png', NULL, NULL, NULL, '<p><strong>חציר הרים Little One הוא דשא שגדל באופן טבעי בשמש. מכיוון שחציר הוא חלק מרכזי בתזונה של כל חיות המחמד אוכלות העשב (ארנבות, שפני נסיונות, צ\'ינצ\'ילות, דגוסים), יש צורך לספק חציר לצמיתות לחיית המחמד שלך. ל-Hay Little One יש מגוון בוטני עשיר; הוא מספק סיבים חיוניים הדרושים לבריאות השיניים ולעיכול תקין. חציר גם יכול לשמש בצורה מושלמת כמצעים ובידור, מכיוון שחיות המחמד שלכם יכולות לחפור ולבנות ממנו קנים.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '400', '95', NULL, NULL),
(4787, '931870', NULL, NULL, 14, NULL, 'קן לפינק 12 ס\"מ', '6971555931870', '25', '4.9', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1),
(4788, '781577', NULL, NULL, 32, 97, 'ליטל וואן חטיף חרובים למכרסמים 200 ג\'', '4602533781577', '19', '7.82', NULL, NULL, '478820211230154133.png', NULL, NULL, NULL, '<p><strong>שעועית חרוב או ארבה היא שעועית ייחודית הגדלה באזור הים התיכון בלבד. פרי ייחודי זה אף הוזכר בתנ\"ך בגלל תכונותיו המזינות יוצאות הדופן. החרוב עשיר בויטמיני B, סידן, ברזל, מגנזיום ומינרלים נוספים. בגלל טעמם המתוק נראה שעועית הלוקוס היא האהובה על כל חיות המחמד.</strong></p><p><strong>מוצעים כנשנוש או כמזון משלים למכרסמים.</strong></p><p><strong>האכילו 1-2 כפיות מדי יום, תלוי בגודל חיית המחמד.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '200', '95', 2, NULL),
