(4979, '253257', NULL, NULL, 19, 98, 'עצם חזיר מעושנת XL חוות סראנו 600 ג\'', '5414365253257', '35', '8.11', NULL, NULL, '497920220110101301.jpg', NULL, NULL, NULL, '<p><strong>עצמות טבעיות מעושנות בעלות מראה חייתי ומפתה במיוחד, שכל כלב יאהב. מזון רך משלים לכלב מגזע בינוני עד גדול.</strong></p><p><strong>מזון רך משלים לכלב מגזע בינוני עד גדול הוראות הזנה: יש לספק מים לשתייה. אינו מיועד לכלבים מתחת לגיל 9 חודשים. יש להשגיח על חיית המחמד בזמן אכילת העצם עקב נטייתם להתפרק לחתיכות קטנות וחדות, דבר מהווה סכנה במקרה של בליעה. יש להשליך את חתיכות העצם הקטנות ישר לאחר מציאתן. המוצר עלול להכתים שטיחים ובדים בהירים.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '600', '109', 0, NULL),
