(4981, '506950', NULL, NULL, 36, 79, 'שירותים סגור הייטק ג\'מבו קטיט', '022517506950', '329', '121', NULL, NULL, '498120220104120017.jpg,498120220104120202.jpg', NULL, NULL, NULL, '<p class=\"ql-direction-rtl\">שירותים סגורים לחתול קטיט ג\'מבו נוחים במיוחד לשימוש ומאפשרים הוצאה קלה של ההתגבשות על ידי פתיחה רחבה של המכסה העליון .השירותים הסגורים מאפשרים לחתול פרטיות ומונעים ריחות.</p><p>מידות : 57 ס\"מ L x 46 ס\"מ H x 43 ס\"מ </p><p>מידות (פתח דלת): 26.5 ס\"מ H x 24.5 ס\"מ </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '88', 4, NULL),
