(4983, '781584', NULL, NULL, 32, 97, 'ליטל וואן חטיף גזר מיובש למכרסמים 200 ג\'', '4602533781584', '27', '9.97', NULL, NULL, '498320211230155011.png', NULL, NULL, NULL, '<p><strong>לפני שאנו משתמשים בגזר מיובש במזון לחיות המחמד שלנו, הוא מעובד באמצעים מתקדמים לייבוש, ובכך משמר את טעם הגזר וחומרי הזנה שלמים. חלק מהגזרים בתזונה היומיומית יהפכו את חיית המחמד לפעילה, יחזקו את המערכת החיסונית שלה וימרצו תהליכי התחדשות בגוף.</strong></p><p><strong>מוצעים כנשנוש או כמזון משלים למכרסמים.</strong></p><p><strong>האכילו 1-2 כפיות מדי יום, תלוי בגודל חיית המחמד.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '200', '95', 6, NULL),
(4984, '784653', NULL, NULL, 32, 97, 'ליטל וואן חטיף ויטמין C למכרסמים 180 ג\'', '4602533784653', '39', '15.64', NULL, NULL, '498420211230160255.png', NULL, NULL, NULL, '<pre class=\"ql-syntax\" spellcheck=\"false\">לשרקנים, צ\'ינצ\'ילות וחיות מחמד אחרות יש צורך מיוחד בויטמין C. חזירי ים אינם יכולים לסנתז את הוויטמין בעצמם, ולכן הם צריכים לקבל בו כמויות מספקות מהתזונה שלהם. Little One ויטמין C הוא תערובת של פירות יער, פירות וירקות עם תכולת ויטמין C המקסימלית.\n</pre>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '180', '95', 5, NULL),
