(5027, '913156', NULL, NULL, 19, 66, 'חטיף ג\'רהיי תות 70 ג\'', '8851759913156', '19.9', '6.9', NULL, NULL, '502720220103161607.png', NULL, NULL, NULL, '<p><strong>JerHigh Carrot Stick הוא חטיף פרימיום מלא בחומרים מזינים וויטמינים כדי להפוך את הכלב לבריא וחזק, עם טעם גזר טעים ומזין שכלבכם לא יוכל לעמוד בפניו. מגיע בצורת מקל, נוח לך להאכיל ולסחוב בזמן שקל וכיף להם לאכול.</strong></p><p><strong>JerHigh Carrot Stick עשוי מבשר עוף אמיתי והוכן בקפידה על ידי צוות המומחים המנוסה שלנו. זה נחקר ונבדק במעבדה כדי להבטיח שהפינוק הוא היגייני, בטוח ומלא בכל אבות המזון שהחבר הטוב ביותר של האדם צריך כדי להישאר בריא ומאושר. אתה יכול להיות סמוך ובטוח ש-JerHigh Carrot Stick הוא הפרס המושלם שמגיע לכלב האהוב עליך.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '70', '84', 19, NULL),
(5028, '200199', NULL, NULL, 10, 72, 'פירסט מייט חתול אינדור 6 ק\"ג', '072318200168', '179', '85.5', NULL, NULL, '502820220116085609.jpg', NULL, NULL, 'עוף טחון,דגי אוקיינוס טחונים,שיבולת שועל, אורז חום, שומן עוף()משומר עם ויטמין E ,)חומצה זרחתית,DL -מתיונין, דיקלציום פוספט,כולין כלוריד,טאורין, סידן פרופיונט, אוכמניות, פטל,חמוציות, מינרלים:אבץ פרוטאינאט, ברזל, סידן פחמתי,חלבון מנגן, נחושת, שמרי סילניום, סידן יוד ויטמינים: תוסף ויטמין E ,ניאצין, תאמין מונוניטרט,חומצה פנטוטנית, תוסף ויטמין A ,ריבופלבין, פירידוקסין הידרוכלוריד, ביוטין, תוסף ויטמין B12 ,ויטמין D3 ,חומצה פולית, קייל, תמצית שמרים.\nערכים תזונתיים:\nחלבון 35% \nשומן 12% \nלחות 10%\n סיבים 4% \nאפר 9% \nסידן 1.6% \nזרחן 1.2%\nמגנזיום 0.18%', '<p><strong style=\"color: rgb(0, 0, 0);\"><em>פורמולה מקורה של FirstMate משתמשת בעוף קנדי וגידול אנושי, הרינג, אנשובי וסרדינים כמקור בריא לחלבון. פורמולה דלה בשומן, מופחתת קלוריות, היא אופטימלית לחתולי בית. הקטגוריה ידידותית לדגנים חופשית מתירס, חיטה, סויה, תפוח אדמה ואפונה.<span class=\"ql-cursor\">﻿</span></em></strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '94,25,26,27,74', 38, NULL),
