(5190, '48000007', NULL, NULL, 19, 66, 'פודיס חטיף נגיסי בקר 100 גרם', '48000007', '17', '4.3', NULL, NULL, '519020211205224357.jpg', NULL, NULL, NULL, 'חטיפי פודיס נגיסי בקר הינם חטיפים בשריים טעימים במיוחד המתאימים למתן כפינוק בכל זמן רצוי, לסיוע באילוף או כתוספת טעימה לארוחה.\n החטיפים עשויים עם מרכיבים טבעיים ללא דגנים וללא גלוטן, ללא תוספת חומרי טעם או צבע מלאכותיים. ', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '100', '62', 46, NULL),
(5191, '2024103', NULL, NULL, 10, 72, 'סאינס פלן חתול בוגר טונה 3 ק\"ג', '052742024103', '129', '69', NULL, NULL, '519120220116123514.jpg', NULL, NULL, NULL, '<p><strong style=\"color: rgb(43, 30, 30);\"><em>מזון יבש לחתולים (עם טונה) המכיל חלבון איכותי לסיוע בבניית מסת שריר רזה. מספק ויטמין E וחומצות שומן מסוג אומגה 3 ו-6 לעור בריא, ומינרלים מאוזנים לתמיכה בבריאות האיברים החיוניים.</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>החתול הבוגר שלכם זקוק למזון המסייע לבריאות העיכול, לפרווה מבריקה, לשרירים רזים ולמערכת חיסון בריאה. מזון יבש Hill\'s Science Plan לחתולים בוגרים מיוצר ממרכיבים איכותיים וקלים לעיכול בנוסחה שפותחה במיוחד לסיפוק צורכי האנרגיה של חתולים במיטב שנותיהם.</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>כמזון לחתולים המיוצר ממרכיבים איכותיים ביותר, Hill\'s Science Plan לחתולים בוגרים מספק ויטמין E בתוספת חומצות שומן מסוג אומגה 3 ואומגה 6 לטיפוח עור החתול. מזון משובח זה, הגדוש בחלבון איכותי, מסייע גם לחתול שבגר לבנות שרירים רזים.</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>בנוסף, מזון יבש לחתולים בוגרים מספק לחתול הבוגר טאורין חיוני ומינרלים מאוזנים התומכים בבריאות הלב, ובתפקוד שלפוחית השתן והכליות.</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>מומלץ עבור:</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>חתולים בוגרים בני 1-6 שנים</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>יתרונות עיקריים:</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>▸ מזון יבש לחתולים בוגרים המכיל טאורין המסייע לבריאות הלב, בתוספת מינרלים מאוזנים לתמיכה בבריאות הכליות ושלפוחית השתן</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>▸ מכיל חלבון ממקור איכותי המסייע לחתול הבוגר לבנות מסת שריר רזה ולשמור עליה</em></strong></p><p><strong style=\"color: rgb(43, 30, 30);\"><em>▸ מספק ויטמין E בתוספת חומצות שומן מסוג אומגה 3 ו-6 המסייעים לעור ופרווה בריאים לחתול הבוגר.</em></strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '3', '39,26,74,40', 34, NULL),
