(5195, '200632', NULL, NULL, 10, 72, 'פירסט מייט ח\' עוף אוכמניות נט\"ד 4.54 ק\"ג', '072318200632', '199', '90', NULL, NULL, '519520220116090345.jpg', NULL, NULL, 'דגיי אוקיינוס טחונים, תפוחי אדמה, שומן עוף (משומר עם ויטמין E), אוכמניות שלמות, מינרלים (אבץ פרוטאינאט, ברזל פרוטאינאט, מנגן פרוטאינאט, נחושת פרוטאינאט, סידן יודאט, קרבונט קובלט, סודיום סלניט), ויטמינים (ניאצין, תיאמין מונוניטראט, D-קלציום פנטוטנאט, ריבופלאבין, פירידוקסין הידרוכלוריד, חומצה פולית, ביוטין, תוסף ויטמין B12 ,תוסף ויטמין E ,תוסף ויטמין A ,תוסף ויטמין D3 ) אשלגן כלוריד, סידן פרופיאינט , DL מתיונין, טאורין, תמצית שמרים(מקור של פרה-ביוטיקה), קייל, גלוקוזאמין הידרוכלוריד\n* שומן העוף בו משתמשים בפירסט מייט, עובר תהליך של עיבוד נטול חלבון על מנת לבטל את הסיכון לאלרגיות  הנובעות מעוף.\nערכים תזונתיים\nחלבון 42%\n שומן 18%\n לחות 10%\n סיבים 3% \nאפר 7% \nסידן 1.9% \nזרחן 1.2% \nמגנזיום 0.89%', '<p><strong style=\"color: rgb(51, 51, 51);\"><em>תזונה מלאה, החלבון והפחמימה מגיעים ממקור אחד בלבד. הגישה הפשוטה שלנו לתזונה, משפרת את תהליכי העיכול וממזערת את הסבירות לתגובות אלרגיות.</em></strong></p><p><strong style=\"color: rgb(51, 51, 51);\"><em>* מכיל עוף אשר גדל בצורה הומניטרית, מחוץ לכלובים</em></strong></p><p><strong style=\"color: rgb(51, 51, 51);\"><em>* מגנזיום ואפר נמוכים</em></strong></p><p><strong style=\"color: rgb(51, 51, 51);\"><em>• ערך גליקמי נמוך – מונע השמנת יתר ובעיות סכרת</em></strong></p><p><strong style=\"color: rgb(51, 51, 51);\"><em>• מכיל אוכמניות לתמיכה בפעילות מערכת שתן תקינה</em></strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '4.54', '25,26,27,94,74,19', 41, NULL),
(5196, '200601', NULL, NULL, 10, 72, 'פירסט מייט ח\' דג אוכמניות נט\"ד 4.54 ק\"ג', '072318200601', '199', '90', NULL, NULL, '519620220116084634.jpg', NULL, NULL, 'דגיי אוקיינוס טחונים, תפוחי אדמה, שומן עוף (משומר עם ויטמין E), אוכמניות שלמות, מינרלים (אבץ פרוטאינאט, ברזל פרוטאינאט, מנגן פרוטאינאט, נחושת פרוטאינאט, סידן יודאט, קרבונט קובלט, סודיום סלניט), ויטמינים (ניאצין, תיאמין מונוניטראט, D-קלציום פנטוטנאט, ריבופלאבין, פירידוקסין הידרוכלוריד, חומצה פולית, ביוטין, תוסף ויטמין B12 ,תוסף ויטמין E ,תוסף ויטמין A ,תוסף ויטמין D3 ) אשלגן כלוריד, סידן פרופיאינט , DL מתיונין, טאורין, תמצית שמרים(מקור של פרה-ביוטיקה), קייל, גלוקוזאמין הידרוכלוריד\n* שומן העוף בו משתמשים בפירסט מייט, עובר תהליך של עיבוד נטול חלבון על מנת לבטל את הסיכון לאלרגיות  הנובעות מעוף.\nערכים תזונתיים:\nחלבון 42% \nשומן 18% \nלחות 10% \nסיבים 3% \nאפר 7% \nסידן 1.9% \nזרחן 1.2% \nמגנזיום 0.89%', '<p><strong style=\"color: rgb(0, 0, 0);\"><em>מזון נטול דגנים פורמולת אוכמניות היא אידיאלית לחתולים וחתלתולים בכל שלבי החיים. מכיל הרינג, אנשובי וסרדינים הם המקור העיקרי לחלבון. ארוחה דגים של FirstMate Ocean Pacific עם אוכמניות היא פורמולה דלת פחמימות, דגנים וגלוטן העשירה בנוגדי חמצון ודלה באפר ומגנזיום.</em></strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '4.54', '94,25,26,27,74,19', 42, NULL),
