(5375, '884129', NULL, NULL, 10, 72, 'פרו-פלן חתול קיבה רגישה הודו 3 ק\"ג', '3222270884129', '119', '65.34', NULL, NULL, '537520211206174925.jpg', NULL, NULL, 'הודו (18%), קמח גלוטן תירס, אורז, חלבוני הודו מיובשים, תרכיזי חלבוני \nאפונה, שומן מן החי, חלבון סויה, עמילן תירס, אבקת ביצים, תירס, אבקש עולש \nמיובש (2%), מינרלים, שמן דגים, מצוי מן החי, שמרים.            \nתכולה תזונתית באחוזים           \n\n\nחלבון 40% (מינ\'),\nשומן 18% (מינ\') ,\nרטיבות 12% (מקס\'),\nאפר % 7 (מקס\'),\nתאית 0.5% (מקס\'),\nסידן 1.3% (מינ\'),\nזרחן 1.3% (מינ\'),\nמלח 0.4% (מקס\'),\nטאורין 0.15% (מינ\') \nתכולה קלורית: 3,550 קק\"ל / ק\"ג\n            \n\n\n           \n\n            ', 'פרו פלאן DELICATE, מזון יבש מלא לחתולים בוגרים, מיועד להתמודדות \nאופטימלית עם רגישויות במערכת העיכול. כולל רמות גבוהות של הוויטמינים A, C\n ו-E, העוזרים בשמירה על בריאות מערכת החיסון. \n\nתכונות ויתרונות\nתומך בבריאות מערכת העיכול ומצמצם בעיות מעיים  \nמכיל פורמולה מבוססת חלבון עדין, קל לעיכול וטעים במיוחד \nמכיל את נוסחת ה-OPTIRENAL, המוכחת מחקרית בשמירה על בריאות הכליות בחתולים \n\n        \n        ', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '3', '26,40,21', 53, NULL),
