(5590, '071567', NULL, NULL, 12, 85, 'סרה ספונד קולור סטיקס 1000מ\"ל/170גרם', '4001942071567', '45', '13.9', NULL, NULL, '559020220225121934.png,559020220225121959.jpg', NULL, NULL, 'קמח חיטה, קמח דגים, עמילן תירס, קריל (4%), שמרי בירה, שמן דגים (המכיל 49% חומצות שומן אומגה), נבט חיטה, גמארוס, אוליגוסכרידים של מנן, סרפד עוקץ, אספסת, עשבי תיבול, מול ירוק-שפתיים, פטרוזיליה , אצות ים, פפריקה, ספירולינה, תרד, גזר, שום, אצות המטוקוקוס.\nמרכיבים אנליטיים:\nחלבון גולמי 29.5%, שומן גולמי 5.4%, סיבים גולמיים 3.2%, לחות 5.0%, אפר גולמי 5.4%.\nתוספים:\nויטמינים ופרוביטמינים: ויט. A 8,000 IU/kg, Vit. D3 1,000 IU/kg, ויט. E (D, L-α-tocopheryl acetate) 100 מ\"ג/ק\"ג, ויט. B1 10 מ\"ג/ק\"ג, ויט. B2 10 מ\"ג/ק\"ג, דקירה. ויט. C (L-ascorbyl monophosphate) 100 מ\"ג/ק\"ג.', '<p><strong>המאכל הצבעוני לדגי בריכה</strong></p><p><strong>sera Pond Color Sticks Nature הוא המזון הצבעוני המורכב מגרגירים מעובדים בקפידה ללא צבעים וחומרים משמרים לדגי בריכה.</strong></p><p><strong>מרכיבים יקרי ערך כמו קריל (4%), העשיר מאוד בקרוטנואידים טבעיים, תומכים בצביעה ובטוהר האופטימליים של הצבעים. ההרכב המאוזן והקל לעיכול עשיר בחומצות שומן אומגה, ויטמינים, יסודות קורט ומינרלים תומך בהתפתחות בריאה, עמידות למחלות וחיות.</strong></p><p><strong>זה מתאים כתזונה בריאה לאורך כל השנה. המקלות הצפים שומרים בצורה יוצאת דופן על צורתם ואינם מזהמים את המים.</strong></p><p><br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '170', '119,134,137', NULL, NULL),
