(5927, '781591', NULL, NULL, 32, 97, 'ליטל וואן חטיף מיקס פירות למכרסמים 200 ג', '4602533781591', '27', '9.97', NULL, NULL, '592720211230215330.png', NULL, NULL, NULL, '<p><strong>פירות יבשים, זה הרבה יותר מתבשיל גורמה פשוט עבור חיות מחמד ביתיות. בננות הן מוצר מזין מאוד עשיר באשלגן. אננס מכיל כמויות גדולות של קרוטן, ויטמינים A ו-C, ויטמיני B שונים, מגנזיום, כלור ויוד. צימוק עשיר במלחים מינרלים, חומצות אורגניות וויטמינים</strong>.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '200', '95', 3, NULL),
(5928, '781737', NULL, NULL, 32, 97, 'ליטל וואן חטיף פירות יער למכרסמים 200גרם', '4602533781737', '33', '12.49', NULL, NULL, '592820211230214936.png', NULL, NULL, NULL, '<p><strong>פירות יער מגוונים הם המקור העשיר ביותר לחומרים מזינים. ברזל ועמילן מיובש מכילים כמויות גדולות של ויטמין C. ג\'וניפר ידוע כצמח מרפא כבר הרבה מאוד שנים. הגרגרים שלו מייצרים השפעות מועילות על מערכת העיכול, כמו גם על העור והפרווה של בעלי חיים. גרגרי עוזרר, בנוסף לחומרים פעילים ביולוגית מורכבים, מכילים גם פקטין שהוא כלי גמילה מצוין.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '200', '95', 0, NULL),
(5929, '781614', NULL, NULL, 32, 97, 'ליטל וואן חטיף עשבי בריאות למכרסמים 100 ', '4602533781614', '27', '9.97', NULL, NULL, '592920211230221433.png', NULL, NULL, NULL, '<p>חיות המחמד שלך יעריכו את פריכיות הצמחים הפריכות העשויות מדגנים מובחרים ועשבי תיבול יבשים. פריכיות צמחים אלו הן לא רק מקור נהדר לסיבים הממריצים את העיכול, אלא גם אמצעי לשיוף השיניים הקטנות הללו.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '100', '95', 1, NULL),
