(5944, '008723', NULL, NULL, 12, 85, 'סרה גולדי גראן 1000מ\"ל/300גרם', '4001942008723', '99', '34', NULL, NULL, '594420220225100645.png', NULL, NULL, 'הזנה מלאה לכל דגי הזהב\nקמח דגים, עמילן תירס, קמח חיטה, הרמטיה (4%), גלוטן חיטה, שמן דגים (המכיל 49% חומצות שומן אומגה), שמרי בירה, אוליגוסכרידים של מנן, מול ירוק שפתיים, שום, אצת המטוקוקוס.\nמרכיבים אנליטיים:\nחלבון גולמי 33.0%, שומן גולמי 6.9%, סיבים גולמיים 3.1%, לחות 5.0%, אפר גולמי 5.7%.\nתוספים:\nויטמינים ופרוביטמינים: ויט. A 14,400 IU/kg, Vit. D3 1,800 IU/kg, ויט. E (D, L-α-tocopheryl acetate) 180 מ\"ג/ק\"ג, ויט. B1 18 מ\"ג/ק\"ג, ויט. B2 18 מ\"ג/ק\"ג, דקירה. ויט. C (L-ascorbyl monophosphate) 180 מ\"ג/ק\"ג.', '<p><strong>מזון מגורען לדגי זהב גדולים יותר עם 4% קמח חרקים</strong></p><p><strong>sera Goldy Gran Nature הוא המזון העיקרי המורכב מגרגירים מיוצרים בעדינות ללא צבעים וחומרים משמרים לדגי זהב גדולים יותר ודגי מים קרים אחרים.</strong></p><p><strong>הודות למרכיבים האיכותיים שלו, כגון ארוחת חרקים, חומצות שומן אומגה ואוליגוסכרידים של מנן, המזון מתעכל מצוין ומספק אפילו את הגרסאות המהודרות והקפדניות ביותר עם כל אבות המזון הנדרשים.</strong></p><p><strong>הדג יגדל בצורה חזקה ללא פיטום, וההתנגדות למחלות מוגברת. הגרגירים הצפים שומרים על צורתם ואינם מזהמים את המים.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '300', '119,133,137', NULL, NULL),
