(6136, '575770', NULL, NULL, 10, 72, 'פריסקיז דגים כחול 7.2 ק\"ג', '050000575770', '139', '81.72', NULL, NULL, '613620211213175841.jpg', NULL, NULL, 'תירס טחון, קמח גלוטן תירס, קמח שיירי עוף, קמח סויה, שומן בקר מוגן על ידי\n טוקופרולים מקור טבעי לויטמין E, קמח בשר ועצמות, קמח דגי אוקיינוס, מצוי \nכבד, חומצה פוספורית ,קמח סלמון, מלח, קלציום קרבונאט, כולין כלוריד, קמח \nסרטנים,אשלגן כלוריד, טאורין, אבץ סולפאט, ברזל סולפאט, מנגן סולפאט, נחושת\n סולפאט, קלציום יודאט, סלניום, ויטמין E, ניאצין, ויטמין A, קלציום \nפאנטוטנאט, תיאמין, ריבופלאבין, ויטמין B12, פירידוקסין, חומצה פולית, \nויטמין D3, ביוטין, ויטמין K, טעם פילה מיניון, צבע מאכל אדום 40, L \nטריפטופאן, DL מתיונין, צבע מאכל צהוב 5, צבע מאכל כחול 2.\n\nחלבון 30% (מינ\') שומן 11% (מינ\') תאית 3% (מקס\') רטיבות 12% (מקס\') חומצה \nלינולאית 1.2% (מינ\') סידן 1.0% (מינ\') זרחן 0.8% (מינ\') אפר % 7.2 (מקס\') \nמלח 1.42% (מקס\') אבץ 125 מ\"ג/ק\"ג (מינ\') ויטמין A 10,000 יחב\"ל/ק\"ג (מינ\')\n ויטמין E 100 יחב\"ל/ק\"ג (מינ\') טאורין 0.12% (מינ\') \nתכולה קלורית: 3,581 קק\"ל / ק\"ג \n            \n\n', 'פריסקיז מעדני הים, מזון מלא במרקם יבש לחתולים. משלב טעמים מושלמים \nמהים של דג אוקיינוס, סלמון, טונה, שרימפס וסרטנים עם נגיעה של אצות ים. \nמעניק תזונה מאוזנת ומלאה לחתולים לאורך כל שלבי חייהם.\n\n\nתכונות ויתרונות\nמסייע לחתולי בית לשמור על משקל בריא ותומך במסת שריר חזקה ורזה \nמסייע לשמירה על בריאות העיניים בזכות תוספת של ויטמין A וטאורין \nשומר על בריאות העור והפרווה בעזרת אבץ וחומצות שומן חיוניות \nמכיל נוגדי חמצון שמעניקים חיזוק למערכת החיסון של החתול \nמספק תזונה מאוזנת לחתול בכל שלבי חייו \n\n        \n        ', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '7.2', '48', 50, NULL),
