(6147, '575800', NULL, NULL, 10, 72, 'פריסקיז מעדני הבית ירוק 7.2 ק\"ג', '050000575800', '139', '81.72', NULL, NULL, '614720211213185354.jpg', NULL, NULL, 'תירס טחון, קמח גלוטן תירס, קמח שיירי עוף, קמח בשר ועצמות , קמח סויה, \nשומן בקר מוגן על ידי טוקופרולים מקור טבעי לויטמין E,  קמח שיירי הודו, \nאבקת תאית, מצוי כבד, קליפות סויה, תמצית מאלט , חומצה פוספורית,קלציום \nקרבונאט, מלח,  כולין כלוריד, אשלגן כלוריד, אבקת גבינה מיובשת, פתיתי \nפטרוזיליה , צבעי מאכל, טאורין, אבץ סולפאט,ויטמין E, ברזל סולפאט, צהוב \nמס\' 6, מנגן סולפאט, ניאצין, צהוב מס\' 5, אדום 40, ויטמין A, קלציום \nפאנטוטנאט, תיאמין מונוניטראט, כחול מס\' 2, נחושת סולפאט, \nריבופלאבין,ויטמין B12, פירידוקסין, חומצה פולית, ויטמין D3 , קלציום \nיודאט, ביוטין, קומפלקס מנדיון סודיום ביסולפיט(מקור לפעילות ויטמין K1), \nסלניום.            \nתכולה תזונתית באחוזים:                \nחלבון 30% (מינ\') שומן 9% (מינ\') תאית 5% (מקס\') רטיבות 12% (מקס\') ח. \nלינולאית 1.5% (מינ\') סידן 1.4% (מינ\') זרחן 1.3% (מינ\') אפר % 7.4 (מקס\') \nמלח 1.42% (מקס\') אבץ 125 מ\"ג/ק\"ג (מינ\') טאורין 0.12% (מינ\') ויטמין A \n10,000 יחב\"ל/ק\"ג (מינ\') ויטמין E 100 יחב\"ל/ק\"ג (מינ\')\nתכולה קלורית: 3,341 קק\"ל / ק\"ג', '<pre class=\"ql-syntax\" spellcheck=\"false\">פריסקיז מעדני הבית, מזון במרקם יבש לחתולים, מכיל שילוב מעודן של ארבעה מקורות חלבון מן החי: עוף, בקר, הודו וגבינה, המסייע למניעת היווצרות כדורי שיער (Hair balls)\nתכונות ויתרונות\nמעניק 100% תזונה מלאה ומאוזנת לחתולים בכל שלבי חייהם\nעוזר לשמור על עור ופרווה בריאים ומסייע במניעת כדורי פרווה\nשומר על מערכת החיסון של החתול בעזרת נוגדי חמצון\nשומר על הראייה של החתול בעזרת טאורין וויטמין A\n\n\n</pre><p><br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '7.26', '48,12', 49, NULL),
