(8303, '421848', NULL, NULL, 10, 61, 'שימורי פריסקיז הודו  156 ג\'', '050000421848', '6.9', '3.67', NULL, NULL, '830320220209152009.png', NULL, NULL, 'בשר ומוצרי לוואי, מים, הודו, שיירי עוף, דגים, נתחי לבבות עוף, אורז, \nחומרי טעם טבעיים ומלאכותיים, מלח, גואר גומי, קלציום פוספאט, צבעי מאכל, \nאשלגן כלוריד, קארגינאן, מגנזיום סולפאט, טאורין, כולין כלוריד, תיאמין \nמונו ניטראט,ויטמין E , אבץ סולפאט,ברזל סולפאט, ניאצין,  קלציום \nפאנטוטנאט, נחושת סולפאט, ויטמין A , מנגן סולפאט, קומפלקס מנדיון סודיום \nביסולפיט(מקור לפעילות ויטמין K1),  פירידוקסין (ויטמין B6) ,ריבופלאבין, \nויטמין B12 , ביוטין, חומצה פולית, ויטמין D3 , אשלגן יודיד. \n            \nתכולה תזונתית באחוזים           \n\n  חלבון כללי: 10% (מינ\'), שומן כללי: 5% (מינ\'), תאית כללית 1% \n(מקס\'), רטיבות 78% (מקס\'), אפר 3.0% (מקס\'), מלח 0.57% (מקס\'), סידן 0.4% \n(מינ\'), זרחן 0.3% (מינ\'), טאורין 0.05% (מינ\'). אנרגיה מטבולית 175 \nקק\"ל/פחית.\n            \n\n\n           \n\n            ', '<p>פריסקיז מזון לח במרקם פטה מתובל ועשיר בטעמים של הודו ועוף שחתולים לא עומדים בפניו. מעניק לחתולים חוויית טעם עשירה ומפנקת.</p><ul><li>100% תזונה מלאה לחתולים</li><li>מעניק חווית טעם עשירה ומפנקת</li><li>פורמולה עם רמות תזונה אופטימליים</li><li>מזון טעים שחתולים לא עומדים בפניו</li></ul><p><br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '156', '48,72', 131, NULL),
