(8667, '939121', NULL, NULL, 10, 72, 'אקויליבריו חתול בוגר 7.5 ק\"ג', '7896588939121', '219', '99', NULL, NULL, '866720220116094950.jpg', NULL, NULL, 'עוף מבושל, אורז מבושל, דגים, עוף לפי ארוחה לפי תוצרת, תירס צהוב טחון **, ארוחת גלוטן תירס **, תאית אבקתית, שמרים יבשים מבשלים, כבד עופות, זרעי פשתן טחונים, שומן עופות (שמור עם טוקופרולים מעורבבים ושמן רוזמרין טבעי ), עוף שעובר הידרוליזציה, שמן דגים, עיסת סלק, אינולין, דיקלציום פוספט, כולין כלוריד, DL-מתיונין, טאורין, מלח, מנה-אוליגוסכרידים, פרוביוטיקה, נתרן ביסולפט, שמן מינרלי, פסיליום, אשלגן כלורי, תמצית Yucca schidigera, נתרן Hexametaphosphate, premix ויטמין, מינרל Premix Chelate.\n\n\nתכולה תזונתית באחוזים: חלבון גולמי (מינימום) 33%, שומן גולמי (מינימום) 18%, סיבים גולמיים 3.5%, לחות 10%, אפר 7%, סידן 1.1% , זרחן  0.8%, טאורין  0.18%, DL-מתיונין  0.57%, אינולין 0.55%, מנהן אוליגוסכרידים 0.3%, פרוביוטיקה 1%.\n\n\n', '<p><strong style=\"color: rgb(0, 0, 0);\"><em>אקווליבריו חתולים הינו מזון מלא ומאוזן,&nbsp;נוסחת המזון של אקוויליבריו בוגר מכילה עוף אמיתי נטול עצמות.</em></strong></p><p><strong style=\"color: rgb(0, 0, 0);\"><em>מועשר בטאורין Taurine לחיזוק וסיוע הראייה, כלי הדם, ובריאות הלב.</em></strong></p><p><strong style=\"color: rgb(0, 0, 0);\"><em>רמות PH אופטימליות המונעות היווצרות אבנים בדרכי השתן.</em></strong></p><p><strong style=\"color: rgb(0, 0, 0);\"><em>המזון מונע כדורי שיער Hairball במערכת העיכול בעזרת שילוב מרכיבים יעודיים.</em></strong></p><p><strong style=\"color: rgb(0, 0, 0);\"><em>מכיל YUCCA המפחית את ריחות השתן והצואה.</em></strong></p><p><strong style=\"color: rgb(0, 0, 0);\"><em>רמות PH אופטימליות המונעות היווצרות אבנים בדרכי השתן.</em></strong></p><p><strong style=\"color: rgb(0, 0, 0);\"><em>מכיל פרוביוטיקה כדוגמת FOS ו MOS, תזונה עשירה בסיבים תזונתיים בלתי מתעכלים.</em></strong></p><p><strong style=\"color: rgb(0, 0, 0);\"><em>עומד בדרישות התקן האמריקאי למזון חתולים A.A.F.C.O.</em></strong></p><p><br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '7.5', '37,26,12,74', 4, NULL),
