(10485, '045707', NULL, NULL, 10, 61, 'פנסי פיסט נטורל עוף&בקר ברוטב עדין 57 גר', '05045707', '7.9', '4.15', NULL, NULL, '1048520211221193000.jpg', NULL, NULL, 'עוף, ציר עוף, בקר, שמן חמניות, טריקלציום פוספאט, קלציום לקטאט, מלח, גואר\n גומי, אבקת סלרי, כולין כלוריד, אשלגן כלוריד, טאורין, מינרלים: אבץ \nסולפאט, מגנזיום סולפאט, ברזל סולפאט, נחושת סולפאט, אשלגן יודיד, סלניום, \nקסנטאן גומי, ויטמינים: ניאצין, תיאמין מונוניטראט, ויטמין E, קלציום \nפאנטוטנאט, ויטמין A, פירידוקסין, ויטמין D3 , ריבופלאבין, חומצה פולית, \nביוטין, קומפלקס מנדיון סודיום ביסולפיט (מקור לפעילות ויטמין K1), ביוטין,\n ויטמין B12, E-6407.            \n\nתכולה תזונתית באחוזים      \nחלבון כללי 14.5% (מינ\'), שומן כללי 2.5% (מינ\'), תאית כללית \n0.5% (מקס\'), אפר 1.37% (מקס\'), מלח 0.07% (מקס), סידן 0.24% (מינ\'), זרחן \n0.19% (מינ\'), רטיבות 82% (מקס\'), אנרגיה מטבולית: 50 קק\"ל/ מגשית.                \n           ', '<p><strong>פיורלי פנסי פיסט Purely Fancy Feast נתחי עוף ובקר ברוטב עדין</strong>Purely Fancy Feast נתחי עוף ובקר ברוטב עדין, מזון גורמה, מוקפד ואיכותי במיוחד לחתולים אניני טעם! מיוצר מרכיבים בשריים טבעיים בריכוז חלבון גבוה, ללא חומרים משמרים וללא צבעי מאכל. מעניק לחתולים 100% תזונה מלאה ומאוזנת לארוחה מפנקת ועשירה.</p><h3><strong>תכונות ויתרונות</strong></h3><ul><li>מכיל חלבון איכותי ממקור בשרי של בשר ועוף בריכוז גבוה.</li><li>רכיבים טבעיים שנבחרו בקפידה על בסיס עוף ובשר.</li><li>ללא חומרים משמרים וללא צבעי מאכל.</li><li>100% תזונה מלאה ומאוזנת של ויטמינים ומינרלים טבעיים</li><li>מעניק לחתול חווית טעם מוקפדת, עשירה ועסיסית</li><li>מוגש במגשית קטנה שהותאמה לחתול</li></ul><p><br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '57', '59', 99, NULL),
