(11075, '293339', NULL, NULL, 10, 61, 'שימורי פריסקיז אקסטרא גרייבי סלמון 156 ג', '050000293339', '6.9', '3.67', NULL, NULL, '1107520220209154254.png,1107520220209154337.png,1107520220209154414.png', NULL, NULL, 'מים, עוף ,כבד, בשר ומוצרי לוואי, גלוטן חיטה, סלמון, קמח סויה, עמילן תירס\n מעובד, חומרי טעם טבעיים ומלאכותיים, טריקלציום פוספאט, אשלגן כלוריד, \nמונו ודיקלציום פוספאט, אבץ סולפאט, ברזל סולפאט, נחושת סולפאט, מנגן \nסולפאט, אשלגן יודיד, טאורין, צבעי מאכל, מלח, כולין כלוריד, תיאמין \nמונוניטראט, ויטמין E, ניאצין, קלציום פאנטוטנאט, ויטמין A,קומפלקס מנדיון \nסודיום ביסולפיט(מקור לפעילות ויטמין K1),  פירידוקסין (ויטמין B6) \n,ריבופלאבין, ויטמין B12 , ביוטין, חומצה פולית, ויטמין D3 , B626718.\n\n            \nתכולה תזונתית באחוזים           \n\nחלבון כללי 9% (מינ\'), שומן כללי 2.5% (מינ\'), תאית כללית 1% \n(מקס\'), רטיבות 82% (מקס\'), אפר 3% (מקס\'), מלח 0.17% (מקס\'), סידן 0.23% \n(מינ\'), זרחן 0.19% (מינ\'), טאורין 0.05% (מינ\'). אנרגיה מטבולית 82 קק\"ל/ \nפחית.\n            \n\n\n           \n\n\n            ', '<p><strong>פריסקיז צ\'אנקי סלמון עם אקסטרה רוטב</strong></p><p>פריסקיז EXTRA GRAVY, מזון לח עשיר ברוטב בדיוק כמו שחתולים אוהבים. נתחי צ\'אנקי בטעם סלמון ברוטב עשיר וטעים במיוחד, מעניק לחתול חווית טעם מפנקת ועשירה.</p><ul><li>מזון לח EXTRA GRAVY בטעם סלמון</li><li>נתחי צ\'אנקי לחווית טעם מפנקת ועשירה</li><li>EXTRA רוטב ל- EXTRA טעם</li><li>100% תזונה מלאה לחתולים</li><li>מזון טעים שחתולים לא עומדים בפניו</li></ul><p><br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '156', '48', 109, NULL),
