(11762, '100659', NULL, NULL, 11, 69, 'פירסט מייט עוף נט\"ד גזע קטן 6.6 ק\"ג', '072318100659', '219', '110.25', NULL, NULL, '1176220211229153718.jpg', NULL, NULL, NULL, '<p><strong>ט כופתיות קטנות, עוף עם אוכמניות משתמש חופשיים בחצרות, עוף קנדי כחלבון בשר יחיד הכולל הכלאה גבוהה של אוכמניות לטובת נוגדי החמצון שלהם. פורמולת המרכיבים המוגבלת הזו נטולת דגנים וגלוטן, היא אידיאלית להאכלה יומיומית ורגישויות.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '6.6', '94', 16, NULL),
(11763, '706749', NULL, NULL, 57, 68, 'אאוט! מנקה ומרחיק בע\"ח אנזימטי 945 מ\"ל', '010279706749', '99', '31.35', NULL, NULL, '1176320220117151220.jpg', NULL, NULL, NULL, '<p><strong><em>מנקה כתמים קשים עם חמצן 945 מ\"ל נוסחה עוצמתית המכילה אנזימים פעילים ופרו בקטריות לנטרול מירבי של ריחות וכתמים אורגנים : צואה, שתן, קיא, אוכל, דם, לכלוך מנטרל במהירות ריחות קשים במקום כיסוי שטחי. מסיר פרומונים הגורמים לבעלי החיים לבקר באותה הנקודה</em></strong></p><p><strong><em><u>הוראות שימוש:</u> נער את הבקבוק לפני כל שימוש. לפני שימוש ראשון יש למרוח כמות קטנה על שטח קטן מלא על מנת לבדוק אם יש דהיית צבע. לא ניתן לשימוש על צמר או עור.</em></strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '115', 3, NULL),
