(12015, '016461', NULL, NULL, 19, 98, 'סיגר וניל דנטלי 12.5 ס\"מ 7 יח\' 60 גרם', '7290013016461', '15.9', '5.93', NULL, NULL, '1201520220213183246.jpg', NULL, NULL, NULL, '<p><strong>חטיף לעיסה, מכיל קמח תפוח אדמה, קמח אפונה, עוף, גליצרין, שמן ירקות, שמרי בירה , קרמל, תרד ,עגבניות מיובשות.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '60', '51', 8, NULL),
