(12124, '828840', NULL, NULL, 19, 66, 'אנימונדה דנטל סטיק 7 יח\' M כ 10-25 180גר', '4017721828840', '29', '7.56', NULL, NULL, '1212420211228224643.png', NULL, NULL, 'דגנים, נגזרות ממקור צמחי, בשר ונגזרות מהחי, שמנים ושומנים, מינרלים (בין היתר 0.6% נתרן הקסמטפוספט).', '<p><strong>animonda® Dental Sticks הם חטיפי טיפול שיניים טעימים התומכים בבריאות השיניים אצל כלבים בוגרים. הם מכילים את החומר הפעיל Stay-C®, שיכול למנוע הצטברות אבנית על בסיס ויטמין C. האכלה יומית יכולה למזער את הצמיחה של חיידקים יוצרי פלאק ולהפחית אבנית.</strong></p><p><br></p><p><strong>יוצר בגרמניה.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '180', '45,51', 42, NULL),
(12125, '177448', NULL, NULL, 10, 72, 'אקויליבריו חתול מסורס 2 ק\"ג', '3548610177448', '79', '29.25', NULL, NULL, '1212520220217141533.jpg,1212520211211203157.jpg', NULL, NULL, 'עוף מבושל, אורז מבושל, דגים, עוף לפי ארוחה לפי תוצרת, תירס צהוב טחון **, ארוחת גלוטן תירס **, תאית אבקתית, שמרים יבשים מבשלים, כבד עופות, זרעי פשתן טחונים, שומן עופות (שמור עם טוקופרולים מעורבבים ושמן רוזמרין טבעי ), עוף שעובר הידרוליזציה, שמן דגים, עיסת סלק, אינולין, דיקלציום פוספט, כולין כלוריד, DL-מתיונין, טאורין, מלח, מנה-אוליגוסכרידים, פרוביוטיקה, נתרן ביסולפט, שמן מינרלי, פסיליום, אשלגן כלורי, תמצית Yucca schidigera, נתרן Hexametaphosphate, premix ויטמין, מינרל Premix Chelate.\n\nחלבון 33%, שומן 18%, סיבים 3.5%, לחות 10%, אפר 7%, סידן 1.1%, זרחן 0.9%.\n\n', '<p><strong>מזון מיוחד לחתולים מסורסים וחתולות מעוקרות מעל גיל שנה תוצרת ברזיל</strong></p><p><strong>מסייע בשמירה על בריאות בדרכי השתן</strong></p><p><strong style=\"color: rgb(33, 37, 41);\">מכיל אל קרניטין לזירוז חילוף החומרים ושמירה על משקל תקין בשל ירידה בכמות הפעילות הגופנית המתלווה לתהליך הסירוס/עיקור.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '2', '37,26,52', 2, NULL),
