(12335, '0022', NULL, NULL, 28, 104, 'ג\'ל אורוזים אורדנטאלי לכלב ולחתול 70ג', '', '79', '38.83', NULL, NULL, '1233520220117141734.jpg', NULL, NULL, NULL, '<p><strong style=\"color: rgb(32, 33, 36);\"><em>&nbsp;תחזוקה שוטפת של חניכיים ושיניים בריאות ומניעת ריח פה על ידי מניעת פלאק דנטלי. דרך פעולה: הנוסחה היחודית של הג\'ל הופכת אותו לצמיגי, כך שהוא נצמד לשיניים ומאפשר לחומרים האנזימתים לבצע את פעולת פרוק אבן השן הקיימת, ובמקביל למגר בקטריות האחראיות להיווצרות הפלאק וריח הפה.</em></strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '70', '33', 27, NULL),
