(12339, '071109', NULL, NULL, 12, 85, 'סרה קוי רויאל גרגרים מיני  1000 מ\"ל', '4001942071109', '65', '22', NULL, NULL, '1233920220225095826.png,1233920220225095844.jpg', NULL, NULL, 'קמח דגים, עמילן תירס, קמח חיטה, הרמטיה (4%), גלוטן חיטה, שמן דגים (המכיל 49% חומצות שומן אומגה), שמרי בירה, אוליגוסכרידים של מנן, מול ירוק שפתיים, שום, אצת המטוקוקוס.\nמרכיבים אנליטיים:\nחלבון גולמי 33.0%, שומן גולמי 6.9%, סיבים גולמיים 3.1%, לחות 5.0%, אפר גולמי 5.7%.\nתוספים:\nויטמינים ופרוביטמינים: ויט. A 14,400 IU/kg, Vit. D3 1,800 IU/kg, ויט. E (D, L-α-tocopheryl acetate) 180 מ\"ג/ק\"ג, ויט. B1 18 מ\"ג/ק\"ג, ויט. B2 18 מ\"ג/ק\"ג, דקירה. ויט. C (L-ascorbyl monophosphate) 180 מ\"ג/ק\"ג.', '<p><strong>sera Koi Royal Nature Mini (2 מ\"מ/0.078 אינץ\') הוא המזון העיקרי המורכב מגרגירים מעובדים בקפידה ללא צבעים וחומרים משמרים.</strong></p><p><strong>מרכיבים יקרי ערך כגון חומצות שומן אומגה ואוליגוסכרידים מנאן ממריצים את מערכת החיסון תומכים בהתפתחות הבריאה ובהתנגדות למחלות. 4% מארוחת חרקים מגידול בר קיימא משלימים את רשימת המרכיבים המורכבת בקפידה.</strong></p><p><strong>בשל יחס הפחמימות והחלבון המאוזן שלו הוא קל מאוד לעיכול ומתאים מצוין לתזונה בריאה לאורך כל השנה. הדרישות של הקוי מתמלאות בצורה מיטבית. הגרגירים הצפים שומרים על צורתם בצורה טובה במיוחד ואינם מזהמים את המים.</strong></p><pre class=\"ql-syntax\" spellcheck=\"false\">הוראות לשימוש\nלהאכיל פעם או פעמיים ביום במהלך השנה, רק כמה שהחיות תופסות תוך זמן קצר.\n</pre><p><br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'ml', '1000', '119,133,137', NULL, NULL),
