(12352, '071703', NULL, NULL, 12, 85, 'סרה פונד גראנולט 170 גרם (סטיקים)', '4001942071703', '35', '12.9', NULL, NULL, '1235220220225120110.png,1235220220225120157.jpg', NULL, NULL, 'קמח חיטה, קמח דגים, עמילן תירס, שמרי בירה, שמן דגים (המכיל 49% חומצות שומן אומגה), אוליגוסכרידים של מנן, סרפד עוקץ, אספסת, עשבי תיבול, מול ירוק שפתיים, פטרוזיליה, אצות ים, פפריקה, ספירולינה, תרד, גזר , שום, אצת המטוקוקוס.\nמרכיבים אנליטיים:\nחלבון גולמי 32.1%, שומן גולמי 5.0%, סיבים גולמיים 2.6%, לחות 5.0%, אפר גולמי 5.2%.\nתוספים:\nויטמינים ופרוביטמינים: ויט. A 8,000 IU/kg, Vit. D3 1,000 IU/kg, ויט. E (D, L-α-tocopheryl acetate) 100 מ\"ג/ק\"ג, ויט. B1 10 מ\"ג/ק\"ג, ויט. B2 10 מ\"ג/ק\"ג, דקירה. ויט. C (L-ascorbyl monophosphate) 100 מ\"ג/ק\"ג.', '<p><strong>המזון המגורען לדגי בריכה גדולים יותר</strong></p><p><strong>sera Pond Granulat Nature הוא המזון העיקרי המורכב מגרגירים מעובדים בקפידה ללא צבעים וחומרים משמרים עבור כל דגי הבריכה הגדולים יותר כגון קוי ודגי זהב גדולים.</strong></p><p><strong>ההרכב ההרמוני עם שפע של ויטמינים, מינרלים ויחס מאוזן בין פחמימות לעומת חלבון עונה על דרישות הדג. זה ישמור אותם בריאים ופעילים.</strong></p><p><strong>המזון הניתן לעיכול במיוחד תומך בהתפתחות בריאה ומחזק עמידות למחלות. הוא מתאים להאכלה לאורך כל השנה. הגרגירים הצפים שומרים על צורתם לאורך זמן ואינם מזהמים את המים.</strong></p><p><strong>הזנה מלאה לכל דגי הבריכה</strong></p><p><strong>הוראות לשימוש:</strong></p><p><strong>להאכיל פעם או פעמיים ביום במהלך השנה, רק כמה שהחיות תופסות תוך זמן קצר.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '170', '119,133,137', NULL, NULL),
