(12426, '177226', NULL, NULL, 10, 72, 'אקויליבריו חתול סלמון 7.5 ק\"ג', '3548610177226', '229', '115', NULL, NULL, '1242620220217143239.jpg,1242620211221221215.jpg', NULL, NULL, 'עוף מבושל, אורז מבושל, דגים, עוף לפי ארוחה לפי תוצרת, תירס צהוב טחון **, ארוחת גלוטן תירס **, תאית אבקתית, שמרים יבשים מבשלים, כבד עופות, זרעי פשתן טחונים, שומן עופות (שמור עם טוקופרולים מעורבבים ושמן רוזמרין טבעי ), עוף שעובר הידרוליזציה, שמן דגים, עיסת סלק, אינולין, דיקלציום פוספט, כולין כלוריד, DL-מתיונין, טאורין, מלח, מנה-אוליגוסכרידים, פרוביוטיקה, נתרן ביסולפט, שמן מינרלי, פסיליום, אשלגן כלורי, תמצית Yucca schidigera, נתרן Hexametaphosphate, premix ויטמין, מינרל Premix Chelate.\n\nחלבון 33%, שומן 18%, סיבים 3.5%, לחות 10%, אפר 7%, סידן 1.1%, זרחן 0.9%.', '<p><strong style=\"color: rgb(119, 119, 119);\">בשר סלמון טרי לחתול של אקיליבריו הוא מזון מושלם לחתולים בוגרים, הוא מסייע לדרכי השתן ותורם לבריאות השיער בזכות רמות גבוהות של אומגה 6 ו- 3 וחומצות שומן חיוניות שנמצאות בו.</strong></p><p><strong style=\"color: rgb(119, 119, 119);\">שילוב של מרכיבים בטעם יחודי לחתולי בית</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '7.5', NULL, 3, NULL),
