(12455, '343487', NULL, NULL, 9, 68, 'פדים לחינוך גורים ריבוס 14 יח\' 60*60', '7290100343487', '39', '15', NULL, NULL, '1245520220117153926.jpg', NULL, NULL, NULL, '<p><strong>פדים לאימון כלבים לעשיית צרכים במקום מסויים- הפדים מכילים חומר המושך את הכלבים לעשות את הצרכים עליהם. הפדים עבים, סופגים את כל כמות השתן ומונעים נזילה מחוצה להם. בתחתית הפדים יש דבק שמקבע אותם לנקודה אחת ומונע מהכלבים להפוך אותם לאיזשהו משחק.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'יח\'', '14', NULL, 0, NULL),
