(12458, '071000', NULL, NULL, 12, 85, 'סרה מיקס רויאל 1000 מ\"ל', '4001942071000', '59', '22', NULL, NULL, '1245820220225104729.png,1245820220225104752.jpg', NULL, NULL, 'קמח חיטה, קמח דגים, עמילן תירס, גאמרוס (7%), ספירולינה, שמרי בירה, שמן דגים (המכיל 49% חומצות שומן אומגה), הרמטיה, נבט חיטה, גלוטן חיטה, אוליגוסכרידים מנאן, Ca-cazinate, מול ירוק-שפתיים , עשבי תיבול, אספסת, סרפד עוקץ, קריל, פטרוזיליה, אצות ים, פפריקה, שום, תרד, גזר, אצות המטוקוקוס.\nמרכיבים אנליטיים:\nחלבון גולמי 32.0%, שומן גולמי 6.5%, סיבים גולמיים 3.2%, לחות 5.0%, אפר גולמי 6.4%.\nתוספים:\nויטמינים ופרוביטמינים: ויט. A 9,895 IU/kg, Vit. D3 1,237 IU/kg, ויט. E (D, L-α-tocopheryl acetate) 124 מ\"ג/ק\"ג, ויט. B1 12.4 מ\"ג/ק\"ג, ויט. B2 12.4 מ\"ג/ק\"ג, דקירה. ויט. C (L-ascorbyl monophosphate) 124 מ\"ג/ק\"ג.', '<p><strong>התערובת המגוונת לדגי בריכות שונים</strong></p><p><strong>sera Pond Mix Royal Nature הוא המזון הבסיסי המורכב מפתיתים, גרגירים וגמארוס שלם מעובדים בקפידה להאכלה בבריכות עם דגים שונים לאורך כל השנה. כמובן ללא צבעים וחומרים משמרים.</strong></p><p><strong>התערובת המאוזנת מכילה את כל מה שדגי בריכה ממינים וגדלים שונים צריכים להתפתחות בריאה ועמידות חזקה למחלות.</strong></p><p><strong>הקטנים אוכלים את הפתיתים, ואילו הגדולים יכולים לבחור מתוך שלושה גרגירים מלוחים. הגמארוס הטעים העשיר במינרלים (7%) הם פינוק מיוחד. המזון הצף שומר על צורתו לאורך זמן ואינו מזהם את המים.</strong></p><pre class=\"ql-syntax\" spellcheck=\"false\">הזנה מלאה לכל דגי הבריכה\nהוראות לשימוש\nלהאכיל פעם או פעמיים ביום במהלך השנה, רק כמה שהחיות תופסות תוך זמן קצר.\n</pre><p><br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'ml', '1000', '119,132,137,133,134', NULL, NULL);
