(12465, '002103', NULL, NULL, 12, 85, 'סרה ציקליד סטיקס 1000 מ\"ל', '4001942002103', '139', '45.36', NULL, NULL, '1246520220225085031.png,1246520220225085049.jpg', NULL, NULL, 'האכילו פעם או פעמיים ביום, רק כמה שהחיות תופסות תוך זמן קצר.\nרכיבים:\nקמח דגים, עמילן תירס, קמח חיטה, גלוטן חיטה, הרמטיה (4%), שמרי בירה, שמן דגים (המכיל 49% חומצות שומן אומגה), גמארוס, מול ירוק שפתיים, אוליגוסכרידים מנן, אצות המטוקוקוס, שום.\nמרכיבים אנליטיים\nחלבון גולמי 41.9%, שומן גולמי 6.4%, סיבים גולמיים 3.1%, לחות 5.0%, אפר גולמי 5.5%.\nתוספים\nויטמינים ופרוביטמינים: ויט. A 30,000 IU/kg, Vit. D3 1,500 IU/kg, ויט. E (D, L-α-tocopheryl acetate) 60 מ\"ג/ק\"ג, ויט. B1 30 מ\"ג/ק\"ג, ויט. B2 90 מ\"ג/ק\"ג, דקירה. ויט. C (L-ascorbyl monophosphate) 550 מ\"ג/ק\"ג.', '<p><strong>sera Cichlids Sticks Nature הוא מזון הבסיס ללא צבעים וחומרים משמרים המורכב ממקלות המיוצרים בעדינות עבור ציקלידים אוכלי כל גדולים יותר - כמו מינים רבים מדרום אמריקה - ודגים גדולים אחרים.</strong></p><p><strong>המקלות טעימים במיוחד, בשל הכמות הגבוהה של חלבון העיכול בצורה מיטבית מארוחת דגים וחרקים בת קיימא וכן חומצות שומן אומגה. התזונה המאוזנת תומכת בחיות ובהתפתחות בריאה של הדג. המקלות הצפים שומרים על צורתם ואינם מזהמים את המים.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'ml', '1000', '130,134', 1, NULL),
