(12582, '837262', NULL, NULL, 10, 61, 'אנימונדה קרני סניור בקר עוף+גבינה 400 ג\'', '4017721837262', '13.9', '6.8', NULL, NULL, NULL, NULL, NULL, '33% בשר בקר (ריאות, לב, בשר, כליות, עטין), 28% עוף (כבד, קיבה), 4% גבינה, סידן פחמתי, נתרן כלורי.', '<p><strong>Carny® Senior מייצג תזונה טעימה, בריאה ומאוזנת במיטבה עבור חתולים בוגרים מגיל 7 שנים ומעלה. המרכיבים הטריים והבשריים הנבחרים מבטיחים את הטעם שאין דומה לו שחתולים כל כך מעריכים. קרני סניור מספק את כל אבות המזון החיוניים להם זקוק חתול ותיק ומותאם במיוחד לדרישות המיוחדות של חתולים מבוגרים.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '45,27', 14, NULL),
