(12633, '070827', NULL, NULL, 25, 71, 'מיטה דלוקס 2 + מזרון', '8010690043449', '109', '42', NULL, NULL, '1263320220107115342.jpg,1263320220107114935.jpg,1263320220107115015.jpg,1263320220107115427.jpg', NULL, NULL, NULL, '<p><strong>מיטת פלסטיק מבית פרפלסט המתאימה לחתולים וכלבים. למיטה עיצוב מעוגל, בצדדים היא גבוהה ובחזית נמוכה. שימושי מאוד עבור חיית המחמד שלך. כמו כן יש בולמי החלקה- הרגליים של המיטה תומכות בבסיס ומאפשרות יציבות מיטבית. יש חריצים מיוחדים, כדי לאפשר מעבר תקין של אוויר. מיטות פלסטיק סיאסטה דלוקס זמינות בשישה גדלים, לכלבים מכל הגדלים. סיאסטה דלוקס 2, 4, 6 ו -8 מתאימים במיוחד לחתולים. קח את הזמן שלך להחליט איזה צבע אתה מעדיף מהטווח הרחב שלנו: שחור, כסף, לבן, בורדו, ורוד או חום. ניתן להוסיף כרית כלב, מתאימה לכל עונות השנה, בד כותנה או דו צדדי עם צד אחד כותנה והשני קטיפה חמה. מידות: 49*36*17.5</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '93,108', 5, NULL),
(12634, '303812', NULL, NULL, 25, NULL, 'מזרון ספוג ביצים אורטופדי בז\' 8*59*79', '7290113303812', '319', '110.34', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1),
