(12636, '037059', NULL, NULL, 10, 93, 'סאינס פלן קיטן נט\"ד 1.5 ק\"ג', '052742037059', '85', '49.7', NULL, NULL, '1263620211221202204.jpg', NULL, NULL, NULL, '<p>Hill\'s Science Plan ללא דגנים לגור חתול (עם עוף) מנוסח במיוחד לצורכי ההתפתחות של חתלתולים, כך שיקבלו את ההתחלה הטובה ביותר בחיים ויצליחו לגדול באופן שיממש את מלוא הפוטנציאל שלהם. </p><p> </p><p> <strong>יתרונות עיקריים:</strong></p><p>מכיל עוף כמרכיב ראשון</p><p>מנוסח עם רכיבים שאינם מכילים דגנים או גלוטן</p><p>תומך במערכת החיסון ובצמיחה בריאה בחתלתולים</p><p>מכיל DHA משמן דגים המסייע להתפתחות בריאה של המוח והעיניים</p>', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '1.5', '40', 3, NULL),
(12637, '221297', NULL, NULL, 14, 80, 'נוטריברד P15 תוכי גדול טרופי 3 ק\"ג', '5410340221297', '199', '79', NULL, NULL, '1263720211228135750.png', NULL, NULL, NULL, '<p><strong>מזון מאוזן ומלא מבית ורסלה לגה, עם מלוא הצרכים התזונתיים הנחוצים לציפור. מוכח מחקרית, מתכלה לחלוטין ללא בזבוז מזון. מומלץ על ידי וטרינרים. מגיע באריזה של 4 ק\"ג.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '3', '77', 8, NULL),
