(12639, '036984', NULL, NULL, 10, 72, 'סאינס פלן חתול אדולט נט\"ד עוף 1.5 ק\"ג', '052742036984', '85', '47.6', NULL, NULL, '1263920220116121112.jpg', NULL, NULL, NULL, '<p><strong><em>Hill\'s Science Plan ללא דגנים לחתול מבוגר 7+ (עם עוף) תומך בתהליכי הזדקנות של חתולים. מספק תערובת רכיבים סינרגיסטית המסייעת לתמיכה ברמת האנרגיה והפעילות.</em></strong></p><p><strong><em>יתרונות עיקריים:</em></strong></p><p><strong><em>מכיל עוף כמרכיב ראשון</em></strong></p><p><strong><em>מנוסח עם מרכיבים שאינם מכילים דגנים או גלוטן</em></strong></p><p><strong><em>מכיל טאורין החיוני לתמיכה בבריאות הלב ומינרלים מאוזנים לתמיכה בבריאות הכליות ובשלפוחית השתן</em></strong></p><p><strong><em>תומך בבריאות מערכת החיסון, בסיוע בעיכול בריא&nbsp;</em></strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'kg', '1.5', '39,74,19,26,40', 30, NULL),
