(12781, '070706', NULL, NULL, 12, 85, 'סרה ביופלקס 1000 מ\"ל', '4001942070706', '45', '14.9', NULL, NULL, '1278120220225090341.png,1278120220225090421.jpg', NULL, NULL, 'רכיבים:\nקמח חיטה, קמח דגים, קזינט, ספירולינה (1.5%), אוליגוסכרידים של מנן, שמרי בירה, מולים ירוקים, שום, אצות המטוקוקוס.\nמרכיבים אנליטיים:\nחלבון גולמי 21.9%, שומן גולמי 2.7%, סיבים גולמיים 1.9%, לחות 5.0%, אפר גולמי 3.3%.\nתוספים:\nויטמינים ופרוביטמינים: ויט. A 8,000 IU/kg, Vit. D3 1,000 IU/kg, ויט. E (D, L-α-tocopheryl acetate) 100 מ\"ג/ק\"ג, ויט. B1 10 מ\"ג/ק\"ג, ויט. B2 10 מ\"ג/ק\"ג, דקירה. ויט. C (L-ascorbyl monophosphate) 100 מ\"ג/ק\"ג.', '<p><strong>sera Pond Flakes Nature הוא המזון העיקרי המורכב מפתיתים מעובדים בקפידה ללא צבעים וחומרים משמרים עבור כל דגי הבריכה הקטנים יותר כגון דגי זהב וביטרלינג וכן לדגים צעירים.</strong></p><p><strong>ההרכב ההרמוני עם שפע של ויטמינים, מינרלים ויחס פחמימה לעומת חלבון מאוזן עונה באופן אידיאלי על הצרכים, ועונה על הדרישות הטבעיות של הדג. זה ישמור אותם בריאים ופעילים.</strong></p><p><strong>המזון הנקל לעיכול תומך בצמיחה בריאה, פעילות ועמידות למחלות של הדגים, ומתאים להאכלה לאורך כל השנה. מכיוון שהפתיתים שומרים על צורתם וצפים לאורך זמן, הם נאכלים לחלוטין ואינם מזהמים את המים.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'ml', '100', '131,132,119', 2, NULL),
