(12874, '571987', NULL, NULL, 10, 61, 'שימורי פריסקיז נתחי עוף ברוטב 156 גרם', '050000571987', '6.9', '3.67', NULL, NULL, '1287420220209155942.png,1287420220209160019.png,1287420220209160116.png', NULL, NULL, 'מים, עוף, כבד, גלוטן חיטה, הודו, בשר ומוצרי לוואי, עמילן תירס מעובד, קמח\n סויה, חומרי טעם טבעיים ומלאכותיים, קלציום פוספאט, צבעי מאכל , אשלגן \nכלוריד, כולין כלוריד, טאורין, מלח, תיאמין מונוניטראט, ויטמין E ,אבץ \nסולפאט, ברזל סולפאט, ניאצין, קלציום פאנטוטנאט, ויטמין A, קומפלקס מנדיון \nסודיום ביסולפיט(מקור לפעילות ויטמין K1), נחושת סולפאט, מנגן סולפאט, \nפירידוקסין (ויטמין B6) ,ריבופלאבין, ויטמין B12 , ביוטין, חומצה פולית, \nויטמין D3 , אשלגן יודיד. \n\nחלבון כללי: 9% (מינ\'), שומן כללי: 2.5% (מינ\'), תאית כללית 1% (מקס\'), \nרטיבות 82% (מקס\'), אפר 2.5% (מקס\'), מלח 0.28% (מקס\'), סידן 0.3% (מינ\'), \nזרחן 0.3% (מינ\'), טאורין 0.05% (מינ\').אנרגיה מטבולית 130 קק\"ל/פחית.', '<h3><strong>ריסקיז נתחי עוף ברוטב, מזון לח וטעים במיוחד שחתולים אוהבים. מעניק 100% תזונה מלאה ומאוזנת.</strong></h3><ul><li><strong>100% תזונה מלאה ומאוזנת</strong></li><li><strong>מעניק לחתול חווית טעם עשירה ומפנקת</strong></li><li><strong>פורמולה המכילה רמות תזונה אופטימליים</strong></li><li><strong>מזון לח וטעים במיוחד שחתולים לא עומדים בפניו</strong></li></ul><p><br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '156', '48', 21, NULL),
