(12878, '424948', NULL, NULL, 10, 61, 'שימורי פריסקיז דגים&טונה 156 ג', '050000424948', '6.9', '3.67', NULL, NULL, '1287820220209152907.png,1287820220209152931.jpg,1287820220209152957.jpg', NULL, NULL, 'דגי אוקיינוס, שיירי עוף, בשר ומוצרי לוואי,כבד, מים, דגים, טונה, אורז, \nחומרי טעם טבעיים ומלאכותיים, גואר גומי, צבעי מאכל, אשלגן כלוריד, \nקארגינאן, מלח, מגנזיום סולפאט, קלציום פוספאט, כולין כלוריד, ויטמין E, \nטאורין, תיאמין מונו ניטראט, אבץ סולפאט,ברזל סולפאט, ניאצין,  קלציום \nפאנטוטנאט, ויטמין A ,נחושת סולפאט, מנגן סולפאט, קומפלקס מנדיון סודיום \nביסולפיט(מקור לפעילות ויטמין K1),  פירידוקסין (ויטמין B6) ,ריבופלאבין, \nויטמין B12 , ביוטין, חומצה פולית, ויטמין D3 , אשלגן יודיד. \n            \nתכולה תזונתית באחוזים         \n\nחלבון כללי: 11% (מינ\'), שומן כללי: 4% (מינ\'), תאית כללית 1% \n(מקס\'), רטיבות 78% (מקס\'), אפר 3.5% (מקס\'), מלח 0.56% (מקס\'), סידן 0.5% \n(מינ\'), זרחן 0.4% (מינ\'), טאורין 0.05% (מינ\'). אנרגיה מטבולית 169 \nקק\"ל/פחית.\n\n\n            \n\n\n           \n\n            ', '<p>פריסקיז במרקם פטה, מזון לח לחתולים בשילוב טעמים של דגי אוקיינוס וטונה שחתולים לא עומדים בפניו. מעניק 100% תזונה מלאה ומאוזנת בשילוב ארוחה מפנקת במיוחד.</p><ul><li>100% תזונה מלאה לחתולים עשיר בחלבונים</li><li>מעניק לחתול חווית טעם עשירה במרקם מפנק</li><li>פורמולה בעלת רמות תזונה אופטימליים</li><li>מזון טעים במיוחד שחתולים אוהבים</li></ul><p><br></p>', NULL, NULL, NULL, NULL, NULL, NULL, 'gr', '156', '48,72', 25, NULL),
