(15091, '001700', NULL, NULL, 12, 85, 'סרה ויפאן 1000 מ\"ל 210 גרם', '4001942001700', '99', '44.82', NULL, NULL, '1509120220301172547.png', NULL, NULL, 'קמח דגים, קמח חיטה, שמרי בירה, קזינט, הרמטיה (4%), גמארוס, ספירולינה, אבקת ביצים שלמות, אצות ים, אוליגוסכרידים של מנן, שמן כבד בקלה (המכיל 34% חומצות שומן אומגה), עשבי תיבול, אספסת, סרפד עוקץ, פטרוזיליה, פפריקה, מול ירוק שפתיים, תרד, גזר, אצות המטוקוקוס, שום.\nמרכיבים אנליטיים\nחלבון גולמי 48.8%, שומן גולמי 8.0%, סיבים גולמיים 2.9%, לחות 5.0%, אפר גולמי 10.7%.\nתוספים\nויטמינים ופרוביטמינים: ויט. A 37,000 IU/kg, Vit. D3 1,800 IU/kg, ויט. E (D, L-α-tocopheryl acetate) 120 מ\"ג/ק\"ג, ויט. B1 35 מ\"ג/ק\"ג, ויט. B2 90 מ\"ג/ק\"ג, דקירה. ויט. C (L-ascorbyl monophosphate) 550 מ\"ג/ק\"ג.', '<p><strong>sera Vipan Nature הוא המזון העיקרי המורכב מפתיתים צפים ללא צבעים וחומרים משמרים לכל דגי הנוי הנאכלים על פני המים.</strong></p><p><strong>הוא מכיל קמח חרקים כמקור חלבון באיכות גבוהה אשר גם חוסך במשאבים.</strong></p><p><strong>ההרכב המאוזן עם מרכיבים טבעיים ופרה-ביוטיקה מאפשר תזונה קרובה מאוד לטבע התומכת בצמיחה בריאה והתפתחות חזקה. הפתיתים שומרים על צורתם לאורך זמן ואינם מעיבים על המים.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '119,132,137', NULL, NULL),
