(15368, '002035', NULL, NULL, 12, 85, 'סרה ויפאגרן 1000 מ\"ל', '4001942002035', '109', '54', NULL, NULL, '1536820220301172044.png,1536820220301172106.jpg', NULL, NULL, 'עמילן תירס, גלוטן חיטה, קמח דגים, אבקת ביצה מלאה, קזינט, הרמטיה (4%), קמח חיטה, שמן דגים (המכיל 49% חומצות שומן אומגה), שמרי בירה, ספירולינה, נבט חיטה, עשבי תיבול, אספסת, עוקץ סרפד, גאמרוס, אוליגוסכרידים של מנן, פטרוזיליה, אצות ים, פפריקה, אצות המטוקוקוס, תרד, גזר, מול ירוק-שפתיים, שום.\nמרכיבים אנליטיים\n\nחלבון גולמי 41.3%, שומן גולמי 8.1%, סיבים גולמיים 3.5%, לחות 5.0%, אפר גולמי 5.5%.\nתוספים\n\nויטמינים ופרוביטמינים: ויט. A 37,000 IU/kg, Vit. D3 1,800 IU/kg, ויט. E (D, L-α-tocopheryl acetate) 120 מ\"ג/ק\"ג, ויט. B1 35 מ\"ג/ק\"ג, ויט. B2 90 מ\"ג/ק\"ג, דקירה. ויט. C (L-ascorbyl monophosphate) 550 מ\"ג/ק\"ג.', '<p><strong>sera Vipagran Nature הוא המזון העיקרי המורכב מגרגירים רכים המיוצרים בעדינות ללא צבעים וחומרים משמרים לכל הדגים שאוכלים בשכבות המים האמצעיות.</strong></p><p><strong>הוא מכיל קמח חרקים כמקור חלבון באיכות גבוהה אשר גם חוסך במשאבים. ההרכב המאוזן עם מרכיבים טבעיים ופרה-ביוטיקה מאפשר תזונה קרובה במיוחד לטבע התומכת בצמיחה בריאה והתפתחות חזקה.</strong></p><p><strong>הגרגירים השוקעים באיטיות בעלי יכולת העיכול מעולה שומרים על צורתם בצורה טובה במיוחד ואינם מזהמים את המים. בשל המבנה הרך והחלק של החלקיקים המזון הטעים והמאוזן מתאים גם לדגים בעלי פה קטן וגרון צר.</strong></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '119,133', NULL, NULL),
